import React, { useState } from 'react';
/** @jsxImportSource @emotion/react */
import { css } from '@emotion/react';

import colors from '../../constants/colors';
import Button from '../../components/Common/Button/Button';
import { useNavigate } from 'react-router-dom';

const ProfileButton = ({ userId }) => {
	const navigate = useNavigate();
	return (
		<div
			css={css`
				display: flex;
				flex-direction: row;
				justify-content: center;
				align-items: center;
				padding: 14px;
			`}
		>
			<Button
				css={css`
					display: flex;
					justify-content: center;
					align-items: center;
					padding: 10px;
					margin: 10px;
					border: 2px solid ${colors.green100};
					border-radius: 14px;
					box-shadow: none;
				`}
				type="outlined"
				label="FOLLOW"
			/>
			<Button
				css={css`
					display: flex;
					justify-content: center;
					align-items: center;
					padding: 10px;
					margin: 10px;
					border: 2px solid ${colors.green100};
					border-radius: 14px;
					box-shadow: none;
				`}
				type="outlined"
				label="CHAT"
				onClick={() =>
					navigate('/chat/room', {
						state: { roomId: null, receiverId: userId },
					})
				}
			/>
		</div>
	);
};

export default ProfileButton;
